const backendDomain = "http://localhost:8080";


const SummeryApi = {
    signUp : {
        url : `${backendDomain}/api/signup`,
        method : "post",
    },
    signIn : {
        url : `${backendDomain}/api/sign`,
        method : "post",
    }
}

export default SummeryApi;
